import React from 'react';
import FormSearchBug from '../FormSearchBug/FormSearchBug';
import NavMain from '../NavMain/NavMain';

const HomePage = ({handleSubmit, handleInputChange, inputValue, setInputValue, handleOpenModal}) => {
    return ( <>
        <NavMain handleOpenModal={handleOpenModal} modalIsOpen={modalIsOpen} handleCloseModal={handleCloseModal}/>
        <FormSearchBug inputValue={inputValue} handleSubmit={handleSubmit} handleInputChange={handleInputChange} setInputValue={setInputValue}/>

    </> );
}

export default HomePage;
